●iPhone/スマホ等のφ3.5mmイヤホン端子に接続し、カーステレオのFMラジオで聴ける、FMトランスミッター。<br>
●純正のUSBケーブル等で充電しながら使用できる、USB出力端子付き。<br>
●USB出力（定格）5V2.4Aのハイパワー出力で、iPhone/iPad/iPodやタブレット/スマートフォンを充電可能。<br>
●周波数を選ぶだけの簡単操作。(88.3/88.5/88.7/88.9MHz)<br>
 ●微弱無線局規定品。<br>
●ホワイト通電ランプ付き。<br><br>

*USBコードは付属していません。必ず純正のUSBコードにて充電してください。<br><br>
