●Bluetooth対応のスマートフォン/iPhoneの音楽やワンセグ音声をワイヤレスで受信、カーステレオから聴くことができます。<br>
●Bluetoothバージョン3.0仕様。<br>
 従来バージョンや上位バージョン(4.0)とも互換性があり、下位/上位バージョンの携帯電話でもご使用になれます。<br>
●周波数76.0MHz～90.0MHzの範囲から0.1MHz間隔で選択できるフルバンドタイプ。（141ch）<br>
●ブルーLEDディスプレイに、選択中のFM周波数を表示。<br>
ディスプレイ部分は約90°(5段階)に可動。操作/確認しやすい角度に調節できます。<br>
●端末を4台までマルチペアリング(ペアリング設定履歴保持)可能。<br>
●iPadにも最適な最大2.4A出力のハイパワーUSB充電ポート付。<br><br>

